import React from "react";
import { Card, Col, Container, Row } from "react-bootstrap";
import classes from '../components/AddEntryCard.module.css'
const QueuePage = (props) => {
	return (
		<div>
			<h4 className="mb-2">Queue</h4>
			<Container>
				<Row>
						{props.queue.length === 0 &&
						<p>Select <b>queue</b> while adding an entry to add to your queue.</p>}
						{props.queue.length > 0 && 
						props.queue.map((i) => (
							<Col key={i.datetime} xs="4" className="my-3">
								{" "}
								<Card 
									className={i.datetime%2===0 ? classes.articleCard : classes.articleCardTag}
								>
									<a href={i.url}>
										<b>{i.title}</b>
									</a>
									<p>{i.note}</p>
									<hr />
									<p>{i.tags.join(" | ")}</p>
								</Card>
							</Col>
						))}
					</Row>
				</Container>
		</div>
	);
};

export default QueuePage;
